import React, { Component } from 'react'
import {Segment, Image, Grid, GridColumn, GridRow} from 'semantic-ui-react'

export default class Home extends Component {
    IMAGES_PATH = './images/';

    render(){
        return(
            <div className = 'tabContent' >
                <Segment>
                    <Grid>
                        <GridRow>
                            <GridColumn width={8}>
                                    <h1>WHO</h1><span> we are: </span>
                            </GridColumn>
                            <GridColumn width={8}>
                                 <Image size ='large' src={require("" + this.IMAGES_PATH + 'pratt-pretty.jpeg')}/>
                            </GridColumn>
                        </GridRow>
                    </Grid>
                </Segment>
            </div>
        )
    }
}
